import React from "react";

import Stack from "@mui/material/Stack";
import Button from "@mui/material/Button";

const ModifyButton = () => {
  return (
    <Stack spacing={2} direction="row">
      <Button variant="contained">News</Button>
    </Stack>
  );
};

export default ModifyButton;
